wp.domReady( () => {
    // Unregister all blocks except the allowed ones for the custom post type
    const allowedBlocks = [
        'core/heading',
        'core/paragraph',
        'core/list',
        'core/list-item',
        'core/image',
        'excelsior-bootstrap/editor',
    ];

    wp.blocks.getBlockTypes().forEach( blockType => {
        if ( !allowedBlocks.includes( blockType.name ) ) {
            wp.blocks.unregisterBlockType( blockType.name );
        }
    } );

    // Ensure the custom block can only be used once per page
    const blockEditorStore = wp.data.dispatch( 'core/block-editor' );
    blockEditorStore.getBlocks().forEach( block => {
        if ( block.name === 'excelsior-bootstrap/editor' ) {
            blockEditorStore.updateBlockAttributes( block.clientId, { allowedBlocks: allowedBlocks, templateLock: 'all' } );
        }
    } );
} );
